import React, { useState } from 'react';
import axios from 'axios';

const LoanForm = () => {
  const [formData, setFormData] = useState({
    ownHouse: '',
    maritalStatus: '',
    dependents: '',
    loanPurpose: '',
    income: '',
    creditScore: '',
    employmentDuration: '',
    previousHikeDate: '',
    nextHikeDate: '',
    existingLoans: ''
  });

  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const result = await axios.post('http://127.0.0.1:5000/predict', formData);
      setResponse(result.data);
      setError(null);
    } catch (err) {
      console.error("Error submitting form:", err);
      setError(err.response ? err.response.data : "Network Error");
      setResponse(null);
    }
  };

  return (
    <div>
      <h2>Loan Application Form</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Own House:
          <input type="text" name="ownHouse" value={formData.ownHouse} onChange={handleChange} />
        </label>
        <label>
          Marital Status:
          <input type="text" name="maritalStatus" value={formData.maritalStatus} onChange={handleChange} />
        </label>
        <label>
          Dependents:
          <input type="text" name="dependents" value={formData.dependents} onChange={handleChange} />
        </label>
        <label>
          Loan Purpose:
          <input type="text" name="loanPurpose" value={formData.loanPurpose} onChange={handleChange} />
        </label>
        <label>
          Income:
          <input type="text" name="income" value={formData.income} onChange={handleChange} />
        </label>
        <label>
          Credit Score:
          <input type="text" name="creditScore" value={formData.creditScore} onChange={handleChange} />
        </label>
        <label>
          Employment Duration:
          <input type="text" name="employmentDuration" value={formData.employmentDuration} onChange={handleChange} />
        </label>
        <label>
          Previous Hike Date:
          <input type="date" name="previousHikeDate" value={formData.previousHikeDate} onChange={handleChange} />
        </label>
        <label>
          Next Hike Date:
          <input type="date" name="nextHikeDate" value={formData.nextHikeDate} onChange={handleChange} />
        </label>
        <label>
          Existing Loans:
          <input type="text" name="existingLoans" value={formData.existingLoans} onChange={handleChange} />
        </label>
        <button type="submit">Submit</button>
      </form>
      {response && (
        <div>
          <h3>Prediction Results:</h3>
          <p>Eligibility: {response.Eligibility}</p>
          <p>Requested Loan Amount: {response.Requested_Loan_Amount}</p>
          <p>Preferred Repayment Period: {response.Preferred_Repayment_Period}</p>
          <p>EMI: {response.EMI}</p>
          <p>Risk Score: {response.Risk_Score}</p>
        </div>
      )}
      {error && (
        <div style={{ color: 'red' }}>
          <h3>Error:</h3>
          <p>{error.error || error}</p>
        </div>
      )}
    </div>
  );
};

export default LoanForm;
